System.register([],function(e){return{execute:function(){e({_template_label_introduction:"イントロダクション",_template_description_introduction:"イントロダクションは、画像と印象的な見出しを効果的に表示するように設計されたモジュール レイアウトのテンプレートです。",_template_label_timeline:"タイムライン",_template_description_timeline:"タイムラインは、画像とコンテンツを時系列順に表示するように設計されたテンプレートです。",_template_label_general:"一般",_template_description_general:"一般は、コンテンツの背後のストーリーを共有するために作成された長くスクロールするテンプレートを提供します。",_template_label_snapshot:"スナップショット",_template_description_snapshot:"スナップショットは、セクション、ビューのナビゲーション、およびカードを使用して、魅力的な画像を効果的に表示するように設計されたテンプレートです。",_template_label_blankscrollable:"空白のスクロール",_template_description_blankscrollable:"スクロール ページでデザインを作成するための空白のテンプレートです。",_template_label_dash:"ダッシュ",_template_description_dash:"ダッシュは、チャート、マップ、カード、テキストの各ウィジェットを使って主な指標を表示するためのテンプレートです。",_template_label_parallax:"視差",_template_description_parallax:"視差を使用すると、エクスペリエンスにヒーロー画像のレイアウトを追加できます。",_template_label_epic:"エピック",_template_description_epic:"エピックは、Web サイトでの体験を構築するために設計された長くスクロールするテンプレートです。",_template_label_reveal:"表示",_template_description_reveal:"表示は、テーブル、チャート、ブックマークを使って重要なデータ ポイントを強調した説明付きツアーを作成できます。",_template_label_gallery:"ギャラリー",_template_description_gallery:"ギャラリーは、目立つサムネイル画像を使用して豊富なコンテンツを強調するように設計されたテンプレートです。",_template_label_summary:"サマリー",_template_description_summary:"サマリーは、短いテキストの説明と追加コンテンツへの実用的なリンクに焦点を合わせた、2 番目または最後のページとして使用するように作成されたテンプレートです。",_template_label_foldable:"折りたたみ可能",_template_description_foldable:"折りたたみ可能は、ヘッダーとコントローラー ウィジェットを備え、マップに焦点を合わせたシンプルでオープンなインターフェイスのテンプレートです。",_template_label_launchpad:"ローンチパッド",_template_description_launchpad:"ローンチパッドは、コントローラー ウィジェットをページの下部に固定して、マップを強調するようにデザインされたテンプレートです。",_template_label_dart:"ダート",_template_description_dart:"ダートは、マップを強調するテンプレートであり、マップの下部にある固定パネル内にウィジェットが配置されています。",_template_label_jewelrybox:"ジュエリーボックス",_template_description_jewelrybox:"ジュエリーボックスは、マップと組み合わせてリスト内にフィーチャを表示するために作成されたテンプレートです。",_template_label_blankfullscreen:"空白の全画面",_template_description_blankfullscreen:"全画面アプリで独自のデザインを作成するための空白のテンプレートです。",_template_label_quicknavigation:"クイック ナビゲーション",_template_description_quicknavigation:"クイック ナビゲーションでは、1 つのページ上で複数のビューと複数のブックマークをすばやく切り替えることができます。",_template_label_pocket:"ポケット",_template_description_pocket:"ポケットは、マップと半透明のプレースホルダー ウィジェットを含むテンプレートです。 マップと連携する 1 つのメイン ウィジェットを含むアプリの作成に適しています。",_template_label_journey:"旅行",_template_description_journey:"旅行は、ブックマーク ウィジェットとマップを使用して、対話型のツアー体験を提供するように作成されたテンプレートです。",_template_label_ribbon:"リボン",_template_description_ribbon:"リボンは、マップのナビゲーションを制御するブックマークを強調するように設計されたテンプレートです。",_template_label_billboard:"ビルボード",_template_description_billboard:"ビルボードは、シンプルさを念頭に置いて作成されており、マップとコントローラー ウィジェットが含まれています。",_template_label_monitor:"モニター",_template_description_monitor:"モニターは、1 ページのテンプレートで、ダッシュボード レイアウトを使ってデータの視覚効果を整理、追跡、表示するためのさまざまなウィジェットが用意されています。",_template_label_header1:"ヘッダー 1",_template_label_header2:"ヘッダー 2",_template_label_header3:"ヘッダー 3",_template_label_header4:"ヘッダー 4",_template_label_footer1:"フッター 1",_template_label_footer2:"フッター 2",_template_label_footer3:"フッター 3",_template_label_footer4:"フッター 4",_template_label_scenic:"シ―ニック",_template_description_scenic:"シ―ニックを使用すると、複数ページのレイアウトでブックマーク ウィジェットを使用して、注釈ツアーを作成できます。",_template_label_exhibition:"エキシビション",_template_description_exhibition:"エキシビションは、カード、リスト、マップ ウィジェットを使用して、画像とコンテンツを強調する Web サイトを構築するための複数ページのレイアウトを提供します。",_template_label_indicator:"インジケーター",_template_description_indicator:"インジケーターは、モダンなダッシュボードを作成するための独自のウィジェット コレクションを含む複数ページのレイアウトを提供します。",_template_label_block1:"ブロック 1",_template_label_block2:"ブロック 2",_template_label_block3:"ブロック 3",_template_label_block4:"ブロック 4",_template_label_block5:"ブロック 5",_template_label_block6:"ブロック 6",_template_label_grid1:"グリッド 1",_template_label_grid2:"グリッド 2",_template_label_grid3:"グリッド 3",_template_label_grid4:"グリッド 4",_template_label_blankwindow:"空のウィンドウ",_template_label_confirm:"確認",_template_label_alert:"通知",_template_label_simple:"単純化",_template_label_vogue:"ヴォーグ",_template_label_novel:"新規",_template_label_sidebar:"サイドバー",_template_label_tooltip:"ツールチップ",_template_label_blank:"空白の画面",_template_label_centralfloating:"中央にフローティング",_template_label_leftfloating:"左にフローティング",_template_label_rightfloating:"右にフローティング",_template_label_rightdock:"右に固定",_template_label_leftdock:"左に固定",_template_label_stream:"ストリーム",_template_label_guide:"ガイド",_template_label_slideshow:"スライドショー",_template_label_cascade:"カスケード",_template_label_showcase:"ショーケース",_template_label_portfolio:"ポートフォリオ",_template_label_flyer:"フライヤー",_template_label_vacation:"バケーション",_template_description_vacation:"バケーションは、フライ コントローラー ウィジェットとマップを利用してインタラクティブな旅行イベント Web サイトを提供するためのテンプレートです。",_template_label_voyage:"ボヤージュ",_template_description_voyage:"ボヤージュは、3D マップ データがあるフライ コントローラー ウィジェットのインタラクティブな計画済みルートと、ツアーのアトラクションのテキスト、画像、ボタンの各ウィジェットの図が用意されたテンプレートです。",_template_label_carousel:"カルーセル",_template_label_particulars:"特定",_template_label_nopanel:"パネルなし",_template_label_dashboard:"ダッシュボード",_template_description_dashboard:"ダッシュボードは、マップが右上隅にあり、カスタマイズ可能な 5 つのプレースホルダーに囲まれているテンプレートで、簡単にコンテンツを設計できます。",_template_label_seeker:"シーカー",_template_description_seeker:"シーカーは、Web ホーム ページとして設計されたテンプレートです。 ページ上部の検索ウィジェットを使用して、探している情報をすばやく取り出すことができます。",_template_label_booking:"ブッキング",_template_description_booking:"ブッキング テンプレートは、データをふるい分けるための検索ウィジェットとフィルター ウィジェットを含む、複数ページのレイアウトを提供します。 検索結果は別のページに表示され、詳細ウィンドウに詳しい情報が示されます。",_template_label_events:"イベント",_template_description_events:"イベントは、カード ウィジェットとホバー フィーチャを使用してズーム ホバー効果を作成するスクロール テンプレートです。",_template_label_forecast:"予測",_template_description_forecast:"予測では、カード ウィジェット、マップ ウィジェット、およびチャート ウィジェットを使用してレポートで重要な情報を表示するのに加え、描画ウィジェットを使用してエンド ユーザーがマップ上の対象地域をハイライト表示できるようにします。",_template_label_gear:"ギア",_template_description_gear:"ギアは、同じ構造を持つ 4 つのビューを通じて自動再生するセクション ウィジェットを備えたテンプレートで、同じカテゴリ内の異なるコンテンツを表示するのに適しています。",_template_label_route:"ルート",_template_description_route:"ルートは、チャート ウィジェット、リスト ウィジェット、およびブックマーク ウィジェットを使用して、一連の場所を紹介するテンプレートです。ユーザーがそれらの場所への移動を視覚化できるルート案内ウィジェットも含まれています。",_template_label_steps:"手順",_template_label_sketchbook:"スケッチブック",_template_description_sketchbook:"スケッチブックは、データを表現するためのカード ウィジェット、マップ ウィジェット、チャート ウィジェット、およびマップ上の対象地域をハイライト表示するための描画ウィジェットを提供するテンプレートです。",_template_label_blankfullscreenGrid:"空のグリッド",_template_description_blankfullscreenGrid:"グリッド ページで独自のデザインを作成するための空のテンプレートです。",_template_label_blankfullscreengrid:"空のグリッド",_template_description_blankfullscreengrid:"グリッド ページで独自のデザインを作成するための空のテンプレートです。",_template_label_showplace:"場所の表示",_template_description_showplace:"場所の表示は、サイズが同じ 4 つのカード ウィジェットが配置されたテンプレートです。ポイントを合わせると詳細が表示されます。",_template_label_kit:"キット",_template_description_kit:"キットは、3D ツールボックス、ブックマーク、およびマップ ウィジェットを使用して、Web シーンに 3D 効果を表示するテンプレートです。",_template_label_chronology:"時系列",_template_description_chronology:"時系列は、タイムライン ウィジェットおよびマップ ウィジェットを使用して時系列データ パターンを視覚化し、印刷ウィジェットを使用して印刷を行うテンプレートです。 マップの横にあるさまざまなタイプのチャートは、変化する期間の統計情報を表示します。",_template_label_checkerboard:"チェッカーボード",_template_description_checkerboard:"チェッカーボードは、中央にマップ ウィジェット、その周囲にマップに関連したウィジェットが配置されたグリッド ページ テンプレートです。",_template_label_illustrator:"イラストレーター",_template_description_illustrator:"イラストレーターを使用すると、画像、タイムライン、およびマップ ウィジェットを使用して、複数ページのレイアウトで場所を詳細に説明することができます。",_template_label_showroom:"ショールーム",_template_description_showroom:"ショールームは、サイズが同じ 4 つのカード ウィジェットが配置されたテンプレートです。ポイントを合わせると詳細が表示されます。",_template_label_collage:"Collage",_template_description_collage:"Collage は、固定パネル ウィジェットの周囲に複数の画像ウィジェットを表示するグリッド ページ テンプレートです。",_template_label_pamphlet:"Pamphlet",_template_description_pamphlet:"Pamphlet は、マップに焦点を当てた単一の全画面ページ テンプレートです。 カード ウィジェットは、サイド パネルとセクション ビューを持つナビゲーションとして機能し、パンフレットを通じて反転をエミュレートします。",_template_label_avatarboard:"Avatarboard",_template_description_avatarboard:"Avatarboard は、ホバー効果とフリップ効果を持つ複数のカード ウィジェットを表示するグリッド ページ テンプレートです。フラッシュ カードのように、後ろに詳細を追加できます。",_template_label_mapflyer:"Mapflyer",_template_description_mapflyer:"Mapflyer は、マップ ウィジェットとともに座標ウィジェットを使用してインスタント テキストとマップからの位置情報を表示するグリッド ページ テンプレートです。",_template_label_leaflet:"Leaflet",_template_description_leaflet:"Leaflet は、縦方向に配置されたレイアウトで、複数の列ウィジェットの中にテキスト ウィジェットと画像ウィジェットがあるグリッド ページ テンプレートです。",_template_label_index:"インデックス",_template_label_frame:"フレーム",_template_description_frame:"フレームは、境界と構造を認識できるようにする枠付きデザインを備えたテンプレートです。 画像とテキストをボックス内に入れることで、テンプレートでコンテンツが整理され、ナビゲートしやすく感じます。",_template_label_multiverse:"マルチバース",_template_description_multiverse:"マルチバースは、複数のデータ ソースを操作するためのテンプレートです。 データの追加ウィジェットを使用すると、さまざまなソースからデータをインポートして、ユーザーがマップとテーブルを介して複数のデータ ソースを比較および解析できるようにするプロセスを簡素化できます。",_template_label_elevate:"向上",_template_description_elevate:"向上は、コンテンツを強化して、記憶に残るユーザー エクスペリエンスを実現するために作成された複数ページのテンプレートです。 このテンプレートはシンプルなデザインで、ナビゲートしやすい構造のため、ストーリーテリングに最適な選択です。",_template_label_comparatist:"コンパラティスト",_template_description_comparatist:"コンパラティストは、マップ レイヤーを左右に並べて比較するための対話型のスワイプ ウィジェットを備えたテンプレートです。 チャート ウィジェットとフィーチャ情報ウィジェットも、基になっているデータのより包括的な説明を提供します。",_template_label_panorama:"パノラマ",_template_description_panorama:"パノラマは、グリッド レイアウトで中央のマップが 2 つのチャート ウィジェットに囲まれています。 ユーザーは、チャート、リスト、フィルターの各ウィジェットを操作して、マッピングされたデータを異なる視点から解釈できます。",_template_label_lens:"レンズ",_template_description_lens:"レンズは、多次元データ探索用の 2 ページのテンプレートです。 ホーム ページでは、マップ、チャート、フィルターを通じて情報の文脈が説明されています。 2 ページ目のブックマークを使用すると、データの特定のサブセットを調べることができます。",_template_label_datacollector:"データ コレクター",_template_description_datacollector:"データ コレクターは、マップを含む編集ウィジェットを取り入れたテンプレートで、フィーチャの追加、削除、編集を行えます。 左側の折りたたまれたパネル内のチャート、テキスト、リストに加え、ライブ データの主要メトリクスも表示されます。",_template_label_tessellate:"モザイク型",_template_description_tessellate:"モザイク型は、ダッシュボードのようなスクロール ページ テンプレートで、データ ソースの情報を表示するテキスト、チャート、テーブルなどのウィジェットが含まれています。",_template_label_plateau:"プラトー",_template_description_plateau:"プラトーは、ページの上部にフラット ツールバーとウィジェット コンテナーを含む、基本的なモダン アプリ テンプレートです。",_template_label_preface:"序文",_template_description_preface:"序文は、背景の色が分かれている全画面テンプレートです。 コンパクトなブロックに基本的な情報が表示され、概要に適しています。",_template_label_sleuth:"スルース",_template_description_sleuth:"スルースの左側には、ナビゲーション メニューが含まれています。 矢印キーを使用して、コンテンツ アイテムを切り替えます。 各アイテムをクリックすると、右下のパネルに詳細が表示されます。",_template_label_footnote:"脚注",_template_label_iteminfo:"アイテム情報",_template_label_lrsviewer:"LRS ビューアー",_template_description_lrsviewer:" LRS ビューアーは、LRS データのクエリー、検索、基本的な解析を行うために設計されたテンプレートです。 ルートで検索、LRS の特定、ダイナミック セグメンテーションなどのウィジェットを利用できます。 ArcGIS Roads and Highways および ArcGIS Pipeline Referencing のデータを処理します。",_template_label_lrseditor:"LRS イベント エディター",_template_description_lrseditor:"LRS イベント エディターは LRS データを編集および解析するために設計されたテンプレートです。 ポイント イベントの追加、ライン イベントの追加、イベントのスプリット、イベントのマージ、ダイナミック セグメンテーションなどのウィジェットを利用できます。 ArcGIS Roads and Highways および ArcGIS Pipeline Referencing のデータを処理します。",_template_label_lrs_event_editor:"LRS イベント エディター",_template_description_lrs_event_editor:"LRS イベント エディターは LRS データを編集するために設計されたテンプレートです。ポイント イベントの追加、ライン イベントの追加、イベントのスプリット、イベントのマージ、その他のウィジェットを利用できます。 ArcGIS Roads and Highways および ArcGIS Pipeline Referencing のデータを処理します。",_template_label_tab:"タブ",_template_description_tab:"タブはマップ中心のテンプレートで、さまざまなサイドバー コンテンツを開くためのタブが左側にあります。",_template_label_scrutiny:"精査",_template_description_scrutiny:"精査テンプレートは、ページの上部に幅広いバナーがあり、同様に構造化されたスクロール モジュールが下にあります。",_template_label_assessor:"評価",_template_description_assessor:"評価は、3 つのスポットライト カード、マッピング済みの参照、サポート対象の表形式データを通じて、簡略化された概要を提供します。",_template_label_contour:"コンター",_template_description_contour:"コンターは、目立つマップ ビューとそれを補足する下のチャートとコンテキスト テキストによって、広範な検査を容易にします。",_template_label_logbook:"ログブック",_template_description_logbook:"ログブックは複数ページからなるテンプレートで、ホーム ページで主要な統計を記録し、他のスクロール ページでマップ、画像、チャート、テーブルを使用してそれらのデータをより深く探索することで、多面的なデータ探索を可能にします。",_template_label_recap:"リキャップ",_template_description_recap:"リキャップは、主にコンテンツに的を絞った、わかりやすく簡潔なデザインになっています。 画像とテキストがブロックに編成され、トピックの切れ目がわかりやすくなるように空白で区切られています。",_template_label_skyline:"スカイライン",_template_description_skyline:"スカイラインは、プロフェッショナルなサービス プレゼンテーションのために設計された洗練されたテンプレートです。 円形の画像、人目を引くマップ表示、ギャラリー形式のブックマークから成るいくつかのセクションに分かれています。",_template_label_edifice:"エディフィス",_template_description_edifice:"エディフィスは建築可視化と建物管理のための専門テンプレートです。",_template_label_vista:"ヴィスタ",_template_description_vista:"ヴィスタは、建物の徹底した調査のための 2 ページから成る総合的なテンプレートです。",_template_label_booth:"ブース",_template_description_booth:"ブースは、カード ウィジェットのグリッドにコンテンツを整理し、詳細ビューをウィンドウでアクセスできるようにして、集中的な探索を可能にします。",_template_label_faq:"FAQ",_template_description_faq:"FAQ では、アコーディオン ウィジェットを使用してテキスト ウィジェットを整理し、ユーザーが 1 つ以上のアイテムを展開して FAQ の閲覧や詳細なコンテンツの表示を効率化できるようにします。",_template_label_catalog:"カタログ",_template_description_catalog:"カタログでは、左側にコンテンツ カードを積み重ねた主要カラム、右側には効率的なコンテンツ閲覧を行うための、固定の説明エリアとナビゲーション ボタンを備えた、クリーンなレイアウトを提供しています。",_template_label_prism:"プリズム",_template_description_prism:"プリズムでは、エレガントにデザインされた詳細ページにコンテンツを表示しながら、よくある質問に対する明確な回答を見やすく整理された FAQ レイアウトに表示して、ユーザー エンゲージメントを高めることができます。",_template_label_poster:"ポスター",_template_tag_Web_page:"Web ページ",_template_tag_Scrolling:"スクロール",_template_tag_Map_centric:"マップ中心",_template_tag_Map:"マップ",_template_tag_Title:"タイトル",_template_tag_Share:"共有",_template_tag_Swip:"スワイプ",_template_tag_Basemap_Gallery:"ベースマップ ギャラリー",_template_tag_Chart:"チャート",_template_tag_Map_Layers:"マップ レイヤー",_template_tag_Feature_Info:"フィーチャ情報",_template_tag_Legend:"凡例",_template_tag_Section:"セクション",_template_tag_View:"表示",_template_tag_Navigation:"ナビゲーション",_template_tag_Pop_up:"ポップアップ",_template_tag_Accordion:"アコーディオン",_template_tag_Divider:"区切り線",_template_tag_Blank:"空",_template_tag_Dashboard:"ダッシュボード",_template_tag_Logo:"ロゴ",_template_tag_Link:"リンク",_template_tag_Filter:"フィルター",_template_tag_Card:"カード",_template_tag_Query:"クエリー",_template_tag_Spatial_filter:"空間フィルター",_template_tag_Table:"テーブル",_template_tag_List:"リスト",_template_tag_Bookmark:"ブックマーク",_template_tag_Slides:"スライド",_template_tag_WAB_classic:"WAB クラシック",_template_tag_Fullscreen:"全画面",_template_tag_Search:"検索",_template_tag_Sidebar:"サイドバー",_template_tag_Widget_Controller:"ウィジェット コントローラー",_template_tag_Panel:"パネル",_template_tag_Direction:"方向",_template_tag_Route:"ルート",_template_tag_Draw:"描画",_template_tag_Measurement:"計測",_template_tag_Column:"列",_template_tag_Bar:"バー",_template_tag_Fly_Controller:"フライ コントローラー",_template_tag_Route_fly:"飛行のルート",_template_tag_Rotate_fly:"飛行の回転",_template_tag_Edit:"編集",_template_tag_Fullscreen_grid:"全画面グリッド",_template_tag_Grid:"グリッド",_template_tag_Add_Data:"データの追加",_template_tag_Coordinates:"座標",_template_tag_Add_to_map:"マップに追加",_template_tag_Building_Explorer:"ビルディング エクスプローラー",_template_tag_Select:"選択",_template_tag_Splash_window:"スプラッシュ ウィンドウ",_template_tag_Website:"Web サイト",_template_tag_Multipage:"複数ページ",_template_tag_Menu:"メニュー",_template_tag_Screen_Group:"スクリーン グループ",_template_tag_Gallery:"ギャラリー",_template_tag_Timeline:"タイムライン",_template_tag_Print:"印刷",_template_tag_Window:"ウィンドウ",_template_tag_Banner:"バナー",_template_tag_Survey:"調査",_template_tag_Pin:"ピン",_template_tag_Embed:"埋め込み",_template_tag_Flow:"フロー",_template_tag_Indicator:"インジケーター",_template_tag_Auto_play:"自動再生",_template_label_beacon:"ビーコン",_template_description_beacon:"ビーコンは、豊富なビジュアルと構造的な情報を組み合わせるよう設計されたテンプレートです。 大きな画像、主要なハイライト、明確なテキスト セクションをサポートし、トピックやコンセプトをガイドします。",_template_label_harbor:"ハーバー",_template_description_harbor:"ハーバーは、アコーディオン レイアウトの折りたたみ形式のフィルター グループを備えた、マップ中心のテンプレートです。 ユーザーは、動的なフィルター パネルを操作して、表示されるデータを絞り込むことができます。また、コンテキスト ボタンを使用すると、関連ウィンドウやパネルが開き、詳細情報を確認できます。",_template_tag_Swipe:"スワイプ",_template_label_r3new1:"r3new1",_template_description_r3new1:"r3new1。",_template_label_compass:"コンパス",_template_description_compass:"コンパスは、マップ内のデータ、フィーチャ情報、ビジュアル向けの汎用的なパネルを整理するために使用されるグリッド テンプレートです。"})}}});